import React from 'react'
import ProfilePreview from './ProfilePreview'
import {Container} from 'react-bootstrap'

const LoggedInHomescreen = ({name}) => {
    return (
        <>
            <div className="py-3" style={{"minHeight": "82vh", "backgroundImage": "url(https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fwallpapertag.com%2Fwallpaper%2Ffull%2Fb%2Fc%2F4%2F143811-full-size-good-background-1920x1200-for-hd-1080p.jpg&f=1&nofb=1)"}}>
                <ProfilePreview />
            </div>
        </>
    )
}

export default LoggedInHomescreen
